const ParticlesConfig = {
  fpsLimit: 60,
  particles: {
    color: {
      value: "#6b605a"
    },
    number: {
      density: {
        enable: true,
        value_area: 1000
      },
      value: 100
    },
    opacity: {
      value: 1,
      random: false,
      anim: {
        enable: false
      }
    },
    shape: {
      type: "circle"
    },
    size: {
      random: false,
      value: 5
    }
  },
  retina_detect: true
};
        
  

export default ParticlesConfig;
